void separation(int index, double* separationVector) {
    for (int i = 0; i < 3; ++i) {
        separationVector[i] = 0;
    }
    for (int i = 0; i < 3; ++i) {
        if (i != index) {
            double direction[3] = {0, 0, 0};
            for (int j = 0; j < 3; ++j) {
                direction[j] = position[index][j] - position[i][j];
            }
            double distance = std::sqrt(std::pow(direction[0], 2) + std::pow(direction[1], 2) + std::pow(direction[2], 2));
            for (int j = 0; j < 3; ++j) {
                direction[j] /= distance;
                separationVector[j] += direction[j];
            }
        }
    }
}

void alignment(int index, double* alignmentVector) {
    for (int i = 0; i < 3; ++i) {
        alignmentVector[i] = 0;
    }
    for (int i = 0; i < 3; ++i) {
        if (i != index) {
            for (int j = 0; j < 3; ++j) {
                alignmentVector[j] += velocity[i][j];
            }
        }
    }
    for (int j = 0; j < 3; ++j) {
        alignmentVector[j] += alignmentVector[j] / 9;
    }
}

void cohesion(int index, double* cohesionVector) {
    for (int i = 0; i < 3; ++i) {
        cohesionVector[i] = 0;
    }
    for (int i = 0; i < 3; ++i) {
        if (i != index) {
            for (int j = 0; j < 3; ++j) {
                cohesionVector[j] += position[i][j];
            }
        }
    }
    for (int j = 0; j < 3; ++j) {
        cohesionVector[j] /= 9;
    }
}

void migration(int index, double* migrationVector) {
    for (int j = 0; j < 3; ++j) {
        migrationVector[j] = position[0][j] - position[index][j];
    }
}

void confinement(int index, int delta, double* confinementVector) {
    double abc[3] = {0, 0, 0};
    for (int j = 0; j < 3; ++j) {
        abc[j] = position[index][j] - position[0][j];
    }
    double mag = sqrt(pow(abc[0], 2) + pow(abc[1], 2) + pow(abc[2], 2));
    if (mag < delta) {
        for (int j = 0; j < 3; ++j) {
            confinementVector[j] = 0;
        }
    } else {
        double direction[3] = {0, 0, 0};
        for (int j = 0; j < 3; ++j) {
            direction[j] = (position[0][j] - position[index][j]) / mag;
        }
        for (int j = 0; j < 3; ++j) {
            confinementVector[j] = direction[j] * (mag - delta);
        }
    }
}

void obstacleAvoidance(int index, double* obstacleAvoidanceVector) {
    for (int j = 0; j < 3; ++j) {
        obstacleAvoidanceVector[j] = 0;
    }
    for (int j = 0; j < 3; ++j) {
        double abc[3] = {0, 0, 0};
        for (int i = 0; i < 3; ++i) {
            abc[i] = positionObstacle[j][i] - position[index][i];
        }
        double mag = sqrt(pow(abc[0], 2) + pow(abc[1], 2) + pow(abc[2], 2));
        for (int i = 0; i < 3; ++i) {
            obstacleAvoidanceVector[i] -= positionObstacle[j][i] / mag;
        }
    }
}

bool isSafe(int row, int col, vector<vector<bool> >& visited)
{
    return (row >= 0 && row < 256) &&
        (col >= 0 && col < 256) &&
        (arr[row][col] < 40 &&
            !visited[row][col]);
}

bool DFS(int row, int col, vector<pair<int, int> >& list, vector<vector<bool> >& visited)
{
    // These arrays are used to get row and column
    // numbers of 4 neighbours of a given cell
    int rowNbr[] = { -1, 1, 0, 0 };
    int colNbr[] = { 0, 0, 1, -1 };
    queue<pair<int, int> > queue;

    // Mark this cell as visited
    visited[row][col] = true;
    pair<int, int> pair(row, col);
    queue.push(pair);

    while (!queue.empty())
    {
        pair = queue.front();
        queue.pop();
        list.push_back(pair);
        if(list.size()>700){
            return true;
        }
        for (int k = 0; k < 4; ++k)
        {
            if (isSafe(pair.first + rowNbr[k], pair.second + colNbr[k], visited))
            {
                queue.push(make_pair(pair.first + rowNbr[k], pair.second + colNbr[k]));
                visited[pair.first + rowNbr[k]][pair.second + colNbr[k]] = true;
            }
        }
    }
    return false;

}



